import React from 'react'
class RealEstat extends React.Component {
   
  
    render() {
            return (
            <div>
                <img src={this.props.item.image_url} alt="house" />
                <div class="basic-info">
                  <span style="margin-left: 3%;">{this.props.item.beds} BDS | {this.props.item.baths} ba | {this.props.item.sqft} sqr</span>
                  <span style="float: right;margin-right: 3%;">{this.props.item.list_price}$</span>
                </div>
            </div>
            );
    }
  }
  
  export default RealEstat;
